import React, { useState, useEffect } from 'react';
import Dialog from '@material-ui/core/Dialog';
import {
    Card,
    CardHeader,
    CardContent,
    CardActions,
    Divider,
    Grid,
    Button,
} from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';
import {
    MuiPickersUtilsProvider,
    DatePicker
} from '@material-ui/pickers';
import DateFnsUtils from '@date-io/date-fns';

import styles from './styles';
import moment from 'moment';

const DialogStatistical = props => {
    const { open, handleCloseDialog, classes } = props;
    const [selectedDateStart, setSelectedDateStart] = useState(new Date());

    // const handleDateChangeDateStart = date => {
    //     setSelectedDateStart(date);
    // };
    // const handleDateChangeDateEnd = date => {
    //     setSelectedDateEnd(date);
    // };
    const handleClose = () => {
        handleCloseDialog(false);
    };
    // const handleChange = e => {
    //     setValue({
    //         ...value,
    //         [e.target.name]: e.target.value
    //     });
    // };
    
    return (
        <Dialog
            open={open}
            onClose={handleClose}
            aria-labelledby="draggable-dialog-title"
        >
            <div className={classes.root}>
                <Card>
                    <form autoComplete="off" noValidate>
                        <CardHeader title="Add class" />
                        <Divider />
                        <CardContent>
                            <Grid container spacing={1}>
                                <MuiPickersUtilsProvider utils={DateFnsUtils}>
                                    <Grid item md={6} xs={12}>
                                    <DatePicker
                                            inputVariant="outlined"
                                            label="Start date"
                                            format="dd/MM/yyyy"
                                            //onChange={handleDateChangeDateStart}
                                            fullWidth
                                            //value={selectedDateStart}
                                            //minDate={today}
                                            margin="dense"
                                        />
                                    </Grid>
                                    <Grid item md={6} xs={12}>
                                        <DatePicker
                                            inputVariant="outlined"
                                            label="Start date"
                                            format="dd/MM/yyyy"
                                            //onChange={handleDateChangeDateStart}
                                            fullWidth
                                            //value={selectedDateStart}
                                            //minDate={today}
                                            margin="dense"
                                        />
                                    </Grid>
                                </MuiPickersUtilsProvider>
                            </Grid>
                        </CardContent>
                        <Divider />
                        <CardActions>
                            <Grid
                                container
                                direction="row"
                                justify="flex-end"
                                alignItems="flex-end"
                            >
                                <Button 
                                    type="submit" 
                                    color="primary" 
                                >
                                    Save
                                </Button>
                                <Button onClick={handleClose} color="secondary">
                                    Cancel
                                </Button>
                            </Grid>
                        </CardActions>
                    </form>
                </Card>
            </div>
        </Dialog>
    );
};
export default withStyles(styles)(DialogStatistical);
